import React from "react";
// name ,lastName , Speciality, Adress , phone 

// reactstrap components
import {
    Button,
    ButtonGroup,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    Label,
    FormGroup,
    Input,
    Table,
    Row,
    Col,
    UncontrolledTooltip,
    Form,
    FormText
} from "reactstrap";



class AddDoctor extends React.Component {
    constructor(props) {
        super(props);
        this.handleLastNameChange = this.handleLastNameChange.bind(this);
        this.handleNameChange = this.handleNameChange.bind(this);
        this.handleSpecialityChange = this.handleSpecialityChange.bind(this);
        this.handleAddressChange = this.handleAddressChange.bind(this);
        this.handlePhoneChange = this.handlePhoneChange.bind(this);

        this.state = {
            doctor: {
                name: '',
                lastName: '',
                speciality: '',
                address: '',
                phone: ''
            }
        }
    }
    handleLastNameChange = (e) => this.setState({ doctor: { lastName: e.target.value } })
    handleNameChange = (e) => this.setState({ doctor: { name: e.target.value } })
    handleSpecialityChange = (e) => this.setState({ doctor: { speciality: e.target.value } })
    handleAddressChange = (e) => this.setState({ doctor: { address: e.target.value } })
    handlePhoneChange = (e) => this.setState({ doctor: { phone: e.target.value } })
    async componentDidMount() {

    }
    render() {
        return (
            <>
                <div className="content">
                    <Row>
                        <Form>
                            <FormGroup>
                                <Label for="exampleEmail">Name</Label>
                                <Input type="text" name="Name" placeholder="Doctor Name" value={this.state.doctor.name} onChange={this.handleNameChange} />
                            </FormGroup>
                            <FormGroup>
                                <Label for="exampleEmail">Last Name</Label>
                                <Input type="text" name="Last_Name" placeholder="Doctor Lastname" value={this.state.doctor.lastName} onChange={this.handleLastNameChange} />
                            </FormGroup>
                            <FormGroup>
                                <Label for="exampleEmail">Speciality</Label>
                                <Input type="text" name="Speciality" placeholder="Doctor Speciality" value={this.state.doctor.speciality} onChange={this.handleSpecialityChange} />
                            </FormGroup>
                            <FormGroup>
                                <Label for="exampleEmail">Address</Label>
                                <Input type="text" name="Address" placeholder="Doctor Address" value={this.state.doctor.address} onChange={this.handleAddressChange} />
                            </FormGroup>
                            <FormGroup>
                                <Label for="exampleEmail">Phone</Label>
                                <Input type="text" name="phone" placeholder="Doctor phone" value={this.state.doctor.phone} onChange={this.handlePhoneChange} />
                            </FormGroup>
                            <FormGroup>
                                <Button onClick={this.handleBtnClick}>Update event</Button>
                            </FormGroup>
                        </Form>
                    </Row>
                </div>
            </>
        );
    }
}

export default AddDoctor;
